import 'react-native-gesture-handler';

import { StyleSheet, Text, View } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import isAuthenticated from './src/utils/isAuthenticated';

// import AuthStack from './src/router/AuthStack';
// import UnAuthStack from './src/router/UnAuthStack';

//const tester = true;
const Stack = createStackNavigator();

export default function App() {
  return (
    <NavigationContainer style={styles.viewport}>
      <StackNavigator>
        <Stack.Screen name="Home" component={Home} />
        <Stack.Screen name="Notifications" component={Notifications} />
        <Stack.Screen name="Profile" component={Profile} />
        <Stack.Screen name="Settings" component={Settings} />
      </StackNavigator>
      {/* {tester ? <AuthStack/> : <UnAuthStack/>} */}
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
